import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button } from "@material-ui/core";
import HomeIcon from "@material-ui/icons/Home";

import { TextField } from "@material-ui/core";
import actividades from "../actividades.jpg";
//import medidas from "../medidas.png";

class ActividadView extends Component {
  state = {};
  render() {
    return (
      <div className="css-evaluacion">
        <Link to="/">
          <Button
            variant="contained"
            color="default"
            size="small"
            startIcon={<HomeIcon />}
          >
            Regresar
          </Button>
        </Link>
        <h1>{this.props.name}</h1>
        <form autoComplete="off" onSubmit={this.addData}>
          <table>
            <tr>
              <td>
              <tr>
                  <TextField
                    label="En el trabajo"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Trayecto al trabajo"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr></tr>
                <tr>
                  <TextField
                    label="Fin de semana"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="En casa"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
                <tr>
                  <TextField
                    label="Otra actividad"
                    type="text"
                    margin="normal"
                    variant="outlined"
                    //inputRef={(e) => (this.frmNombre = e)}
                  />
                </tr>
              </td>
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
              <td>
                <tr>
                  <img
                    src={actividades}
                    className="App-logo"
                    alt="actividades"
                  />
                </tr>
              </td>
              &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
              <td>
                {/* <tr>
                        <div className={classes.root}>
                          <Typography id="discrete-slider-always" gutterBottom>
                            Always visible
                          </Typography>
                          <Slider
                            defaultValue={80}
                            getAriaValueText={valuetext}
                            aria-labelledby="discrete-slider-always"
                            step={10}
                            marks={marks}
                            valueLabelDisplay="on"
                          />
                        </div>
                      </tr> */}
                <tr>
                  {/* <img src={medidas} className="App-logo" alt="medidas" /> */}
                </tr>
              </td>
            </tr>
          </table>
        </form>
      </div>
    );
  }
}

export default ActividadView;
